    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <style type="text/css">:root {

--plum: #870052;
--cyclamen: #D40963;
--grey: #808080;
--white: #FFFFFF;
--black: #222222;
--main: var(--plum);
--accent: var(--cyclamen);
--text: var(--black);
--text-inverse: var(--white);

--size-tiny: 17px;
--size-scriptsize: 20px;
--size-footnotesize: 20px;
--size-small: 20px;
--size-normalsize: 24px;
--size-large: 29px;
--size-Large: 35px;
--size-LARGE: 42px;
--size-huge: 50px;
--size-Huge: 50px;

--size-references: 18px;
}
.remark-slide-content,
.remark-slide-content p,
.remark-slide-content li p {
color: var(--text);
font-size: var(--size-normalsize);
}
h1, h2, h3, h4, h5, h6 {
color: var(--main);
border: 0px;
margin: 0px;
}
h1 {
font-size: var(--size-LARGE);
}
h2 {
font-size: var(--size-Large);
}
h3 {
font-size: var(--size-large);
}
a, a > code, a:visited {
color: var(--accent);
text-decoration: none;
}
a:hover {
text-decoration: underline;
}
ul {
list-style: square;
}
.footnote {
position: absolute;
bottom: 0%;
left: 15%;
padding-right: 15%;
font-size: var(--size-footnotesize);
}
.footnote p, .footnote a {
font-size: var(--size-footnotesize);
}
.remark-code-line-highlighted {
background-color: var(--accent);
}
.remark-code {
border-radius: 10px;
font-size: var(--size-scriptsize);
}
.remark-inline-code {
font-size: var(--size-normalsize);
}
.inverse {
background-image: none;
background-color: var(--main);
color: var(--text-inverse);
}
.inverse h1,
.inverse h2,
.inverse h3,
.inverse h4,
.inverse h5,
.inverse h6 {
color: var(--text-inverse);
}
.pull-left {
float: left;
width: 45%;
}
.pull-right {
float: right;
width: 45%;
}
.pull-right ~ * {
clear: both;
}
img,
video,
iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px var(--accent);
padding-left: 1em;
color: var(--main);
}
.remark-slide table {
margin: auto;
border-top: 1px solid var(--grey);
border-bottom: 1px solid var(--grey);
}
.remark-slide table thead th {
border-bottom: 1px solid var(--grey);
}
th, td {
padding: 5px;
}
.remark-slide thead,
.remark-slide tfoot,
.remark-slide tr:nth-child(even) {
background: var(--white);
}
@page {
margin: 0;
}
@media print {
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}
.remark-slide-number {
font-size: var(--size-scriptsize);
color: var(--text);
}
.title-slide .remark-slide-number,
.inverse .remark-slide-number {
display: none;
}
.mjx-chtml {
font-size: var(--size-normalsize) !important;
}
